import React from 'react'
import Layout from '../../Components/Layout/Layout'
import SideBar from '../../Components/SideBar/SideBar'

const AddEmplyoee = () => {


    const [firstname, setFirstName] = useState('');
    const [lastname, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [dob, setDob] = useState('');
    const [gender, setGender] = useState('');
    const [address, setAddress] = useState('');
    const [phone, setPhone] = useState('');
    const [department, setDepartment] = useState('');
    const [biography, setBiography] = useState('');
    // const [productDetails, setProductDetails] = useState(null);
    const [doctorImage, setDoctorImage] = useState([]);

    const dispatch = useDispatch();





    const renderAddEmployeeModal = () => {


        const handleSave = () => {

            const form = new FormData();

            form.append('name', name);
            form.append('email', email);
            form.append('phone', phone);
            form.append('lastname', lastname);
            form.append('salary', salary);
            form.append('joindate', joindate);
            form.append('role', role);


            dispatch(addDoctor(form));
        }


        const handleDoctorImage = (e) => {
            setDoctorImage([
                ...doctorImage,
                e.target.files[0]
            ]);
        }




        return (
            <>
                {<SideBar />}
                <div class="page-wrapper">
                    <div class="content">
                        <div class="row">
                            <div class="col-lg-8 offset-lg-2">
                                <h4 class="page-title">Add Employee</h4>
                            </div>
                        </div>
                        <div class="row">
                            <div class="col-lg-8 offset-lg-2">
                                <form method="POST">
                                    <div class="row">
                                        <div class="col-sm-6">
                                            <div class="form-group">
                                                <label> Name <span class="text-danger">*</span></label>
                                                <input class="form-control" type="text" name="name" />
                                            </div>
                                        </div>
                                        <div class="col-sm-6">
                                            <div class="form-group">
                                                <label>Email</label>
                                                <input class="form-control" type="email" name="email" />
                                            </div>
                                        </div>
                                        <div class="col-sm-6">
                                            <div class="form-group">
                                                <label> Contact <span class="text-danger">*</span></label>
                                                <input class="form-control" type="text" name="contact" />
                                            </div>
                                        </div>

                                        <div class="col-sm-6">
                                            <div class="form-group">
                                                <label> Salary <span class="text-danger">*</span></label>
                                                <input class="form-control" type="text" name="salary" />
                                            </div>
                                        </div>
                                        <div class="col-sm-6">
                                            <div class="form-group">
                                                <label>Join Date <span class="text-danger">*</span></label>
                                                <input class="form-control" type="text" name="date" />
                                            </div>
                                        </div>

                                        <div class="col-sm-6">
                                            <div class="form-group">
                                                <label>Role</label>
                                                <select class="" name="role">

                                                    <option value="Nurse">Nurse</option>
                                                    <option value="Laboratorist">Laboratorist</option>
                                                    <option value="Pharmacist">Pharmacist</option>
                                                    <option value="Accountant">Accountant</option>
                                                    <option value="Receptionist">Receptionist</option>
                                                </select>
                                            </div>
                                        </div>
                                    </div>

                                    <div class="m-t-20 text-center">
                                        <button class="btn btn-primary submit-btn">Create Employee</button>
                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            </>
        )
    }


    return (
        <Layout>
            {renderAddEmployeeModal()}
        </Layout>
    )
}

export default AddEmplyoee
